INSERT INTO `translations_template` VALUES ('924', '1', '42', 'DIALOG_PRIVACITY', '<p><span style=\"font-family: Tahoma;\">Â </span></p>\r\n<div style=\"background-color: transparent; \">\r\n<p dir=\"ltr\" id=\"internal-source-marker_0.9087853715755045\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 12pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Privacy Policy for Tagbum.com</span></span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-family: Tahoma;\">Â </span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">What information do we collect?</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Â   Â We collect information from you when you register on our site, place  an order, subscribe to our newsletter, respond to a survey, fill out a  form, or any other nature of business where information is collected.  Â Any data we request that is not required will be specified as voluntary  or optional.Â  Â When ordering or registering on our site, as  appropriate, you may be asked to enter your: name, e-mail address,  mailing address, phone number, credit card information or Oklahoma. You  may, however, visit our site anonymously. Â Like most websites, we use  cookies to enhance your experience, gather general visitor information,  and track visits to our website. Please refer to the \'do we use  cookies?\' section below for information about cookies and how we use  them.</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"> </span></span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \">Â </p>\r\n<p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">What do we use your information for?</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Â   Â Any of the information we collect from you may be used in one of the  following ways:Â  Â ;Â To personalize your experience (your information  helps us to better respond to your individual needs) Â ;Â To improve our  website (we continually strive to improve our website offerings based on  the information and feedback we receive from you) Â ;Â To improve  customer service (your information helps us to more effectively respond  to your customer service requests and support needs) Â ;Â To process  transactions Your information, whether public or private, will not be  sold, exchanged, transferred, or given to any other company for any  reason whatsoever, without your consent, other than for the express  purpose of delivering the purchased product or service requested by the  customer.Â  Â ;Â To send periodic emails Â The email address you provide for  order processing, may be used to send you information and updates  pertaining to your order or request, in addition to receiving occasional  company news, updates, promotions, related product or service  information, etc. Â Note: If at any time you would like to unsubscribe  from receiving future emails, we include detailed unsubscribe  instructions at the bottom of each email. Â ;Â To administer a contest,  promotion, survey or other site feature Â </span></span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \">Â </p>\r\n<p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">How do we protect your information?</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Â   Â We implement a variety of security measures to maintain the safety of  your personal information when you submit a request, place an order or  enter, submit, or access your personal information.Â  Â These security  measures include: password protected directories and databases to  safeguard your information, SSL (Secure Sockets Layered) technology to  ensure that your information is fully encrypted and sent across the  Internet securely or PCI Scanning to actively protect our servers from  hackers and other vulnerabilities.Â  Â We offer the use of a secure  server. All supplied sensitive/credit information is transmitted via  Secure Socket Layer (SSL) technology and then encrypted into our Payment  gateway providers database only to be accessible by those authorized  with special access rights to such systems, and are required to keep the  information confidential. Â After a transaction, your private  information (credit cards, social security numbers, financials, etc.)  will not be stored on our servers. Â </span></span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \">Â </p>\r\n<p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Do we use cookies?</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Â   Â Yes (Cookies are small files that a site or its service provider  transfers to your computers hard drive through your Web browser if you  allow) that enables the sites or service providers systems to recognize  your browser and capture and remember certain information. Â </span></span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \">Â </p>\r\n<p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Do we disclose any information to outside parties?</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Â   Â We do not sell, trade, or otherwise transfer to outside parties your  personally identifiable information. This does not include trusted third  parties who assist us in operating our website, conducting our  business, or servicing you, so long as those parties agree to keep this  information confidential. We may also release your information when we  believe release is appropriate to comply with the law, enforce our site  policies, or protect ours or others\' rights, property, or safety.  However, non-personally identifiable visitor information may be provided  to other parties for marketing, advertising, or other uses. Â </span></span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \">Â </p>\r\n<p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Third party links</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Â   Â Occasionally, at our discretion, we may include or offer third party  products or services on our website. These third party sites have  separate and independent privacy policies. We therefore have no  responsibility or liability for the content and activities of these  linked sites. Nonetheless, we seek to protect the integrity of our site  and welcome any feedback about these sites. Â </span></span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \">Â </p>\r\n<p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">California Online Privacy Protection Act Compliance</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">  Â Because we value your privacy we have taken the necessary precautions  to be in compliance with the California Online Privacy Protection Act.  We therefore will not distribute your personal information to outside  parties without your consent. Â As part of the California Online Privacy  Protection Act, all users of our site may make any changes to their  information at anytime by logging into their control panel and going to  the <strong>Edit Profile</strong> page.</span></span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"> Â </span></span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Childrens Online Privacy Protection Act Compliance</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Â   Â We are in compliance with the requirements of COPPA (Childrens Online  Privacy Protection Act), we do not collect any information from anyone  under 13 years of age. Our website, products and services are all  directed to people who are at least 13 years old or older. Â </span></span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \">Â </p>\r\n<p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">CAN-SPAM Compliance</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Â   Â We have taken the necessary steps to ensure that we are compliant with  the CAN-SPAM Act of 2003 by never sending out misleading information. Â </span></span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \">Â </p>\r\n<p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Online Privacy Policy Only</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Â   Â This online privacy policy applies only to information collected  through our website and not to information collected offline. Â </span></span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \">Â </p>\r\n<p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\">