yle: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Â   Â If we decide to change our privacy policy, we will update the Privacy  Policy modification date below. Policy changes will apply only to  information collected after the date of the change.Â  Â This policy was  last modified onÂ </span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">October 1, 2011</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"> Â </span></span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \">Â </p>\r\n<p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Contacting Us</span><span style=\"font-size: 9pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Â  Â If there are any questions regarding this privacy policy you may contact us using the information below.Â </span></span></p>\r\n<p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \">Â </p>\r\n<p dir=\"ltr\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; \"><span style=\"font-family: Tahoma;\"><img height=\"40px;\" width=\"150px;\" src=\"https://lh6.googleusercontent.com/JeJRRarMng8bETDzkWNn4Hi8TeFhA0xhXitOqhxfKS_n7kBStIFlHkqnh0OrMr6J0Rog